import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div>
      <footer>
        <div className="footer">
          <div className="experience">
              <h5></h5>
          </div>
          <div className="experience">
          <h4>Services</h4>
          </div>
          <div className="experience">
            <h4>Follow Us</h4>

          </div>
          <div className="experience">
          <h4>Contact Us</h4>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
